import React from 'react'

function ExpDateInput() {
  return (
    <div className='w-[45%] flex flex-col gap-2'>
      <label className="uppercase tracking-widest text-xs font-semibold" style={{color: 'hsl(278, 68%, 11%)'}} htmlFor="">Exp. date (MM/YY)</label>
      <div className='w-full flex justify-between'>
        <input className='border-[.5px] border-solid focus:border-violet-800 p-2 outline-none rounded-lg' type="number" placeholder='MM' />
        <input className='border-[.5px] border-solid focus:border-violet-800 p-2 outline-none rounded-lg' type="number" placeholder='YY' />
      </div>
      
    </div>
  )
}
export default ExpDateInput;
